import React, { Component } from 'react';
import {
  // Button,
  Input,
} from 'components';
import axios from 'axios';
import { Lion as Button } from 'react-button-loaders';
import AWS from 'aws-sdk';

import styles from './styles.module.scss';
// import { connect } from 'react-redux';

const rekognition = new AWS.Rekognition();
const cloudwatchlogs = new AWS.CloudWatchLogs({ region: 'eu-central-1' });

AWS.region = 'RegionToUse';
const params = {
  Image: { /* required */
    Bytes: 'data:image/jpeg;base64,' /* Strings will be Base-64 encoded on your behalf */,

  },
};

class ImageInput extends Component {
  constructor(props) {
    super(props);

    this.state = {
      type: 'custom',
      image: {},
      isLoading: false,
    };

    this.onClick = this.onClick.bind(this);
    this.onImageChange = this.onImageChange.bind(this);
    this.onTypeChange = this.onTypeChange.bind(this);
  }

  onClick() {
    const {
      type,
      image,
    } = this.state;

    // rekognition.detectText(params, (err, data) => {
    //   if (err) console.log(err, err.stack); // an error occurred
    //   else console.log(data); // successful response
    // });
    switch (type) {
    case 'custom': {
      this.setState({ isLoading: 'loading' });
      const parse = new FormData();
      parse.append('image', image);
      return axios({
        method: 'post',
        url: 'http://127.0.0.1:5000/files',
        data: parse,
        config: { headers: { 'Content-Type': 'multipart/form-data' } },
      })
        .then((response) => {
          this.setState({ isLoading: 'finished' });
          return this.setState({ name: response });
        })
        .catch((error) => { return console.log(error); });
    }
    case 'amazon':
      return null;
    default: return null;
    }
  }

  onTypeChange(event) {
    const {
      value,
    } = event.target;
    this.setState({ type: event.target.value });
  }

  onImageChange(event) {
    this.setState({ image: event.target.files[0] });
  }

  render() {
    return (
      <div className={styles.wrap}>
        <label className={styles.label}>Service type</label>
        <select onChange={this.onTypeChange}>
          <option value="custom">Сustom</option>
          <option value="amazon">Amazon Rekognition</option>
        </select>
        <form className={styles.imageInput}>
          <label className={styles.upload}>
            <input
              onChange={this.onImageChange}
              type="file"
              name="upload_file"
            />
            {'Upload'}
          </label>
          {/* <Input
            accept="image/*"
            onChange={this.onImageChange}
            className={styles.input}
            required
            placeholder="Click to upload"
            type="file"
          /> */}
          <Button
            type="button"
            onClick={this.onClick}
            state={this.state.isLoading}
            textWhileLoading="Saving"
            className={styles.button}
          >
            {'Send'}
          </Button>
        </form>
        <textarea
          rows="5"
          placeholder="Output text"
          className={styles.outputText}
        />
      </div>
    );
  }
}
export default ImageInput;
